import React, { Component } from 'react';
import { HashLink as Link } from 'react-router-hash-link';

class AccountPanel extends Component {
  render() {
    var links = [
      { text: 'FEEDBACK', link: '/app/feedback' },
      { text: 'FAQ', link: '/app/faq' },
      { text: 'line' },
      { text: 'TERMS OF SERVICE', link: '/app/terms' },
      { text: 'PRIVACY POLICY', link: '/app/privacy' },
      { text: 'line' },
    ];

    return (
      <div className="AccountPanel">
        {links.map((link, index) => {
          if (link.text === 'line') {
            return <div className={'lineItem'} key={index + link.text} />;
          } else {
            return (
              <div
                className={'panelItem'}
                key={index + link.text}
                onClick={() => this.props.history.push(link.link)}
              >
                {link.text}
              </div>
            );
          }
        })}
        <div className={'panelItem'} onClick={this.props.logoutUser}>
          LOGOUT
        </div>
      </div>
    );
  }
}

export default AccountPanel;
